def plot(df, name):

    colors={"navie":"violet", "mu-l1":"red", "pu21-l1":"aquamarine", "pq-l1": "green", "linear-mu":"orange", "linear-pq":"pink", "linear-smape":"brown", "linear-pu":"coral", "linear-l1":"yellow"}
    palette=[]

    column_names = df.columns.tolist()

    for col_name in column_names:
        palette.append(colors[col_name])


    plt.figure(figsize=(26, 8))
    ax = sns.violinplot(data=df,cut = 0, palette=palette)  # remove the bars inside the violins

    if "psnr" in name:
        ax.set_ylim(10, 55)

    if "cvvdp" in name:
        ax.set_ylim(0, 10)

    if "ssim" in name:
        ax.set_ylim(0, 1.05)

    # for i in range(len(df.columns)):
    #     median_val = df.iloc[:, i].median()
    #     plt.text(i+0.13, median_val, f'{median_val:.3f}', horizontalalignment='left', size='large', color='black', weight='semibold')

    plt.show()
    plt.ylabel(name)
    plt.savefig(name + '.png')
    plt.clf()

def combine_results(array):
    res = []
    count = 0
    sum = 0
    for ele in array:
        sum += ele
        count += 1
        if count % 8 == 0:
            res.append(sum / 8.0)
            sum = 0
            count = 0

    return res

